    def test_get_infos_from_a_wrong_barcode_or_code_line(self):
        """
        Dado:
            - Um codigo errado
        Quando:
            - BarcodeService().get_infos_from_barcode_or_code_line(number)
        Então:
            - Deve ser retornado um ValueError com
            ""Código de barras ou linha digitável inválida!""
        """
        number = "12398523356"
        with self.assertRaises(ValueError) as ctx:
            BarcodeService().get_infos_from_barcode_or_code_line(number)
        self.assertEqual(
            str(ctx.exception), "Código de barras ou linha digitável inválida!"
        )
